function utfToText(text) {
  const bytes = [];
  for (let i = 0; i < text.length; i += 2) {
    bytes.push(parseInt(text.substr(i, 2), 16));
  }
  const decoder = new TextDecoder("utf-8");
  const decodedText = decoder.decode(new Uint8Array(bytes));
  components.textarea4.setText(decodedText);
}

utfToText(components.utfText.value);

function utfText(text) {
  const encoder = new TextEncoder();
  const encoded = encoder.encode(text);
  const hexString = Array.from(encoded)
    .map(byte => '\\x' + byte.toString(16).padStart(2, '0'))
    .join('');
  components.textarea5.setText(hexString);
}
